import React from 'react'
import Card from './Card'
import data from './Data'
const Service = () => {


  return (
    <>
     {data.map((val,index)=>{
        return(
          <>
            <Card 
              key={val.id}
              src
            />
          </>
        )
      })}
    </>
  )
}

export default Service
